import React from 'react';
import { Grid } from '@material-ui/core';
import './index.css'

const registerMain = (type) =>{
    return (
        <Grid item>
            <Grid container direction="row" justifyContent="space-evenly" alignItems="center">
            </Grid>
        </Grid>
    );
};

export default registerMain;
